import axios from 'axios';

function meFromToken(tokenFromStorage) {
  const request = axios({
    method: 'get',
    url: `http://jastegri.pythonanywhere.com/auth/users/me/`,
    headers: {
      Authorization: `Bearer ${tokenFromStorage}`,
    },
  });

  return {
    type: 'ME_FROM_TOKEN',
    payload: request,
  };
}

export { meFromToken };
